import * as React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Icon from 'react-native-vector-icons/FontAwesome';
import Search from './Search.js';
import Profile from './Profile.js';
import Chat from './Chat.js';

const Tab = createBottomTabNavigator();

export default () => {
  return (
    <Tab.Navigator initialRouteName="Search">
      <Tab.Screen name="Profile" component={Profile} screenOptions={{ headerShown: false }} options={{
        tabBarIcon: ({ color, size }) => (
          <Icon name="user" size={size} color={color}/>
        )
      }}  />
      <Tab.Screen name="Search" component={Search} screenOptions={{
        headerShown: false
      }} options={{
        tabBarIcon: ({ color, size }) => (
          <Icon name="search" size={size} color={color}/>
        )
      }} />
      <Tab.Screen name="Chat" component={Chat} screenOptions={{ headerShown: false }} options={{
        tabBarIcon: ({ color, size }) => (
          <Icon name="comments" size={size} color={color}/>
        )
      }}  />
    </Tab.Navigator>
  );
}
